import React from 'react';
import { Navbar, Container, Nav } from 'react-bootstrap';
import logo from '../Clique.png';

function NavBar() {

    return (
        <div>
            <Navbar bg="dark" className="navi">
                <Container>
                    <Navbar.Brand href="/">
                        <img
                            src={logo}
                            width="50"
                            height="50"
                            className="d-inline-block align-top"
                            alt="Clique logo"
                        />
                    </Navbar.Brand>
                    <Nav.Link href="/" className="navLinks">Home</Nav.Link>
                    <Nav.Link href="#Myprofile" className="navLinks">Profile</Nav.Link>
                    <Nav.Link href='#Addpost' className="navLinks">'(+)'</Nav.Link>
                    <Nav.Link href="#Signout" className="navLinks">Log Out</Nav.Link>
                 </Container>
             </Navbar>
        </div>
    )
}

export default NavBar;
